import React from "react";
import creditPic from "./creditPic.png";

function Card (props) {
    return (
        <div class="col s12 m7">
            <div class="card">
                <div class="card-image">
                    <img src={creditPic}></img>
                    <span class="card-title">INBOX</span>
                </div>
                <div class="card-content">
                    <p>{props}</p>
                </div>
            </div>
        </div>
    );
}

export default Card;
